	(706, '<pre class="language-css"><code>.pc_comment{<br />  margin-top:10px;<br />  margin-left:100px;<br />  padding: 10px;<br />  margin-bottom: 10px;<br />  font-size: 13px;<br />}<br /><br />#footer{<br />  margin-top:50px; <br />  padding: 20px;<br />  width: 100%;<br />  background: #3B3937;<br />}<br /><br /><br />.read-more-state {<br />  display: none;<br />}<br /><br />.read-more-target {<br />  opacity: 0;<br />  max-height: 0;<br />  font-size: 0;<br />  transition: .25s ease;<br />}<br /><br />.read-more-state:checked ~ .read-more-wrap .read-more-target {<br />  opacity: 1;<br />  font-size: inherit;<br />  max-height: 999em;<br />}<br /><br />.read-more-state ~ .read-more-trigger:before {<br />  content: \'Plus...\';<br />}<br /><br />.read-more-state:checked ~ .read-more-trigger:before {<br />  content: \'Moin...\';<br />}<br /><br />.read-more-trigger {<br />  cursor: pointer;<br />  display: inline-block;<br />  color: #6C94A3;<br />  font-size: 13px;<br />  font-weight: bold;<br />  text-decoration: underline;<br />}<br /></code></pre>', 0, 0, 0, 1, 22, '2016-03-12 01:00:43', '2016-03-12 01:00:43'),
